// Extract TikTok profile data
const results = [];

const data = $json.data || [];
for (const item of data) {
  const author = item.item?.author || {};
  const stats = item.item?.authorStats || {};

  results.push({
    Name: author.nickname || '',
    Username: author.uniqueId || '',
    TikTok_Profile_URL: `https://www.tiktok.com/@${author.uniqueId}`,
    Bio: author.signature || '',
    Followers_Count: stats.followerCount || 0,
    Followings_Count: stats.followingCount || 0,
    Likes_Count: stats.heartCount || 0,
    Videos_Count: stats.videoCount || 0,
    ID: author.id || '',
    PrivateAccount: author.privateAccount || false,
    Bio_Links: author.bioLink || ''
  });
}

return results;

const searchQuery = $input.first().json.searchQuery

// Let's generate cursors for multiple pages (0, 12, 24, ...)
const maxPages = 50; // Adjust as needed
let items = [];

for (let i = 0; i < maxPages; i++) {
  items.push({
    json: {
      searchQuery,
      cursor: i * 12
    }
  });
}

return items;

