const items = $node['Search YouTube API'].json.items;

// Map through the items returned from the YouTube API and extract necessary information
const results = items.map(item => {
    return {
        channelTitle: item.snippet.channelTitle, // Channel Name
        channelId: item.snippet.channelId,       // Channel ID
        description: item.snippet.description   // Channel Description
    };
});

// Return the processed results
return results;

