// Input: The JSON array from the previous node (items[0].json)
// Example: items[0].json = [ { ...channel data... } ]

const data = items[0].json; // This should be your YouTube API response array

function extractChannelInfo(channel) {
  return {
    channelId: channel.channelId,
    Country: channel.country || null,
    description: channel.description,
    hasBusinessEmail: channel.hasBusinessEmail || false,
    isVerified: channel.isVerified || false,
    joinedDate: channel.joinedDate || null,
    keywords: channel.keywords,
    links: (channel.links).map(link => link.targetUrl), // Extract only targetUrl
    subscribers: channel.stats?.subscribers || 0,
    subscribersText: channel.stats?.subscribersText || '',
    videos: channel.stats?.videos || 0,
    views: channel.stats?.views || 0,
    username: channel.username || '',
    YT_Channel_Link: channel.channelId ? `https://www.youtube.com/channel/${channel.username}` : ''
  };
}

const result = Array.isArray(data) 
  ? data.map(extractChannelInfo) 
  : [extractChannelInfo(data)];

return result.map(r => ({ json: r }));

