// Access the JSON output from the previous node
const response = items[0].json;

// Extract channelTitle and channelId for each item in "data"
const results = (response.data || [])
  .filter(item => item.channelId && item.channelTitle)
  .map(item => ({
    channelTitle: item.channelTitle,
    channelId: item.channelId
  }));

// Return as separate items for n8n
return results.map(r => ({ json: r }));

// Get data from the previous HTTP Request node
const response = $json; // or items[0].json

// Ensure timeline exists
const tweets = response.timeline || [];

// Extract required tweet and user details
const twitterProfiles = tweets.map(tweet => {
  const user = tweet.user_info || {};

  return {
    // Tweet Info
    tweet_id: tweet.tweet_id || null,
    tweet_text: tweet.text || null,
    tweet_created_at: tweet.created_at || null,
    favorites: tweet.favorites || 0,
    retweets: tweet.retweets || 0,
    replies: tweet.replies || 0,
    bookmarks: tweet.bookmarks || 0,
    lang: tweet.lang || null,
    media: tweet.media?.photo?.map(m => m.media_url_https) || [],

    // User Info
    screen_name: user.screen_name || null,
    name: user.name || null,
    user_created_at: user.created_at || null,
    description: user.description || null,
    rest_id: user.rest_id || null,
    followers_count: user.followers_count || 0,
    favourites_count: user.favourites_count || 0,
    verified: user.verified || false,
    friends_count: user.friends_count || 0,
    location: user.location || null
  };
});

// Return as new n8n items
return twitterProfiles.map(profile => ({ json: profile }));

