const response = $json;  // or items[0].json

// Ensure response is an array
const profiles = Array.isArray(response) ? response : [response];

// Extract required details
const userDetails = profiles.map(profile => {
  return {
    rest_id: profile.rest_id || null,
    desc: profile.desc || null,
    name: profile.name || null,
    website: profile.website || null,
    sub_count: profile.sub_count || 0,
    statuses_count: profile.statuses_count || 0,
    media_count: profile.media_count || 0,
    avatar: profile.avatar || null,
    business_account: profile.business_account || null
  };
});

// Return as n8n items
return userDetails.map(user => ({ json: user }));

